@kearneymw And an #rstats function of mine that is older than your `rtweet` package and still in hourly use:

tweet &lt;- function(txt) {
  con &lt;- pipe("bti --config ~/.bti.conf", "w")
  cat(txt, file=con)
  close(con)
}

where bti is from the trusted repo https://t.co/I4XaZwn0Fk

